import React from 'react'
import EmployeeTable from './EmployeeTable'
import { Container, Row, Col } from 'react-bootstrap'
import employees from '../employees.json'

const Body = () => {

    return (
        <Container>
            <Row>
                {employees.map((employee) => (
                    <Col>
                        <EmployeeTable employee={employee}/>
                    </Col>
                ))}
            </Row>                  
        </Container>
    )
}

export default Body
